import React, { useState } from 'react';

function MyComponent({ items }) {
  // Create state to manage the active accordion item
  const [activeItem, setActiveItem] = useState(null);

  // Function to handle accordion item clicks
  const handleAccordionItemClick = (index) => {
    setActiveItem(index === activeItem ? null : index);
  };

  return (
    <div className="container shadow">
      <div className="accordion" id="accordionExample">
        {items.map((item, index) => (
          <div className="accordion-item" key={index}>
            <h2 className="accordion-header" id={`heading-${index}`}>
              <button className="accordion-button collapsed" type="button"
                aria-expanded={activeItem === index ? 'true' : 'false'}
                aria-controls={`collapse-${index}`}
              >
                {item.name}
              </button>
            </h2>
            <div id={`collapse-${index}`} className={`accordion-collapse collapse ${activeItem === index ? 'show' : ''}`}
            	aria-labelledby={`heading-${index}`} data-bs-parent="#accordionExample"
            >
              <div className="accordion-body">
                {item.description}
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default MyComponent;
